xA("common/tty.effekt",'module tty\n\n/// Represents a TTY color.\n/// - ANSI for the standard 16 terminal colors\n/// - ANSI256 for standard 256 terminal colors\n/// - NoColor for explicit "this doesn\'t have a set color"\ntype Color {\n  ANSI(code: Int)\n  ANSI256(code: Int)\n  NoColor()\n}\n\n/// Common terminal colors and their constructors\nnamespace Color {\n  // Standard ANSI colors\n  val BLACK \x3d ANSI(0)\n  val RED \x3d ANSI(1)\n  val GREEN \x3d ANSI(2)\n  val YELLOW \x3d ANSI(3)\n  val BLUE \x3d ANSI(4)\n  val MAGENTA \x3d ANSI(5)\n  val CYAN \x3d ANSI(6)\n  val WHITE \x3d ANSI(7)\n\n  // Bright ANSI colors\n  val BRIGHT_BLACK \x3d ANSI(8)\n  val BRIGHT_RED \x3d ANSI(9)\n  val BRIGHT_GREEN \x3d ANSI(10)\n  val BRIGHT_YELLOW \x3d ANSI(11)\n  val BRIGHT_BLUE \x3d ANSI(12)\n  val BRIGHT_MAGENTA \x3d ANSI(13)\n  val BRIGHT_CYAN \x3d ANSI(14)\n  val BRIGHT_WHITE \x3d ANSI(15)\n\n  /// Create an ANSI color from a code\n  def ansi(code: Int): Color \x3d\n    if (code \x3c 16) ANSI(code) else ANSI256(code)\n}\n\n/// Converts a color to its escape code\ndef toEscapeSeq(color: Color): String \x3d color match {\n  case ANSI(code) \x3d\x3e\n    if (code \x3c 8) (code + 30).show else (code + 82).show\n  case ANSI256(code) \x3d\x3e "38;5;" ++ code.show\n  case NoColor() \x3d\x3e ""\n}\n\n/// Common escapes\nnamespace Escape {\n  val CSI \x3d "\\u001b["\n  val OSC \x3d "\\u001b]"\n\n  val RESET \x3d CSI ++ "0m"\n  val BOLD \x3d CSI ++ "1m"\n  val FAINT \x3d CSI ++ "2m"\n  val ITALIC \x3d CSI ++ "3m"\n  val UNDERLINE \x3d CSI ++ "4m"\n  val BLINK \x3d CSI ++ "5m"\n  val REVERSE \x3d CSI ++ "7m"\n  val CROSSOUT \x3d CSI ++ "9m"\n  val OVERLINE \x3d CSI ++ "53m"\n}\n\ndef escape(code: String): String \x3d Escape::CSI ++ code\ndef escapeOSC(code: String): String \x3d Escape::OSC ++ code\n\n// Cursor positioning\ndef cursorUp(x: Int): String \x3d escape(x.show ++ "A")\ndef cursorDown(x: Int): String \x3d escape(x.show ++ "B")\ndef cursorForward(x: Int): String \x3d escape(x.show ++ "C")\ndef cursorBack(x: Int): String \x3d escape(x.show ++ "D")\ndef cursorNextLine(x: Int): String \x3d escape(x.show ++ "E")\ndef cursorPreviousLine(x: Int): String \x3d escape(x.show ++ "F")\ndef cursorHorizontal(x: Int): String \x3d escape(x.show ++ "G")\ndef cursorPosition(x: Int, y: Int): String \x3d escape(y.show ++ ";" ++ x.show ++ "H")\n\n// Screen manipulation\ndef eraseDisplay(x: Int): String \x3d escape(x.show ++ "J")\ndef eraseLine(x: Int): String \x3d escape(x.show ++ "K")\ndef scrollUp(x: Int): String \x3d escape(x.show ++ "S")\ndef scrollDown(x: Int): String \x3d escape(x.show ++ "T")\ndef saveCursorPosition(): String \x3d escape("s")\ndef restoreCursorPosition(): String \x3d escape("u")\ndef changeScrollingRegion(x: Int, y: Int): String \x3d escape(x.show ++ ";" ++ y.show ++ "r")\ndef insertLine(x: Int): String \x3d escape(x.show ++ "L")\ndef deleteLine(x: Int): String \x3d escape(x.show ++ "M")\n\n// Explicit values for eraseLine\ndef eraseLineRight(): String \x3d escape("0K")\ndef eraseLineLeft(): String \x3d escape("1K")\ndef eraseEntireLine(): String \x3d escape("2K")\n\n// Mouse\ndef enableMousePress(): String \x3d escape("?9h")\ndef disableMousePress(): String \x3d escape("?9l")\ndef enableMouse(): String \x3d escape("?1000h")\ndef disableMouse(): String \x3d escape("?1000l")\ndef enableMouseHighlight(): String \x3d escape("?1001h")\ndef disableMouseHighlight(): String \x3d escape("?1001l")\ndef enableMouseCellMotion(): String \x3d escape("?1002h")\ndef disableMouseCellMotion(): String \x3d escape("?1002l")\ndef enableMouseAllMotion(): String \x3d escape("?1003h")\ndef disableMouseAllMotion(): String \x3d escape("?1003l")\ndef enableMouseExtendedMode(): String \x3d escape("?1006h")\ndef disableMouseExtendedMode(): String \x3d escape("?1006l")\ndef enableMousePixelsMode(): String \x3d escape("?1016h")\ndef disableMousePixelsMode(): String \x3d escape("?1016l")\n\n// Screen\ndef restoreScreen(): String \x3d escape("?47l")\ndef saveScreen(): String \x3d escape("?47h")\ndef altScreen(): String \x3d escape("?1049h")\ndef exitAltScreen(): String \x3d escape("?1049l")\n\n// Bracketed paste\ndef enableBracketedPaste(): String \x3d escape("?2004h")\ndef disableBracketedPaste(): String \x3d escape("?2004l")\ndef startBracketedPaste(): String \x3d escape("200~")\ndef endBracketedPaste(): String \x3d escape("201~")\n\n// Session\ndef setWindowTitle(s: String): String \x3d escape("2;" ++ s)\ndef setForegroundColor(s: String): String \x3d escape("10;" ++ s)\ndef setBackgroundColor(s: String): String \x3d escape("11;" ++ s)\ndef setCursorColor(s: String): String \x3d escape("12;" ++ s)\ndef showCursor(): String \x3d escape("?25h")\ndef hideCursor(): String \x3d escape("?25l")\n\ndef applyForegroundColor(color: Color): String \x3d\n  escape(color.toEscapeSeq ++ "m")\n\ndef applyBackgroundColor(color: Color): String \x3d\n  escape("48;" ++ color.toEscapeSeq ++ "m")\n\n/// Inline images\n/// See https://iterm2.com/documentation-images.html for protocol description\n/// See [imgcat](https://iterm2.com/utilities/imgcat) for more usage details\ndef inlineImage(size: Int, base64Image: String) \x3d\n  escape("1337;File\x3dsize\x3d" ++ size.show ++ ";inline\x3d1:" ++ base64Image ++ "\\u0007")\n\n/// Hyperlinks\n/// https://iterm2.com/documentation-escape-codes.html\ndef hyperlink(text: String, url: String): String \x3d\n  escapeOSC("8;;") ++ url ++ "\\u0007" ++ text ++ escapeOSC("8;;") ++ "\\u0007"\n\ndef attention(value: String) \x3d\n  escapeOSC("1337;") ++ "RequestAttention\x3d" ++ value ++ "\\u0007"\n\nnamespace Screen {\n  def clear(): String \x3d eraseDisplay(2) ++ cursorPosition(1, 1)\n  def clearLine(): String \x3d eraseEntireLine()\n}\n\ndef red(text: String) \x3d Formatted::colored(text, Color::RED)\ndef green(text: String) \x3d Formatted::colored(text, Color::GREEN)\ndef yellow(text: String) \x3d Formatted::colored(text, Color::YELLOW)\ndef blue(text: String) \x3d Formatted::colored(text, Color::BLUE)\ndef magenta(text: String) \x3d Formatted::colored(text, Color::MAGENTA)\ndef cyan(text: String) \x3d Formatted::colored(text, Color::CYAN)\ndef white(text: String) \x3d Formatted::colored(text, Color::WHITE)\n\ndef dim(text: String) \x3d Formatted::colored(text, Escape::FAINT)\ndef bold(text: String) \x3d Formatted::colored(text, Escape::BOLD)\ndef underline(text: String) \x3d Formatted::colored(text, Escape::UNDERLINE)\ndef italic(text: String) \x3d Formatted::colored(text, Escape::ITALIC)\n\ninterface Formatted {\n  def supportsEscape(escape: String): Bool\n}\n\nnamespace Formatted {\n  /// Run given block of code, allowing all formatting\n  def formatting[R] { prog : \x3d\x3e R / Formatted }: R \x3d\n    try { prog() } with Formatted {\n      def supportsEscape(escape: String) \x3d resume(true)\n    }\n\n  /// Run given block of code, ignoring all formatting\n  def noFormatting[R] { prog : \x3d\x3e R / Formatted }: R \x3d\n    try { prog() } with Formatted {\n      def supportsEscape(escape: String) \x3d resume(false)\n    }\n\n  def tryEmit(escape: String): String / Formatted \x3d\n    if (do supportsEscape(escape)) escape else ""\n\n  def colored(text: String, escape: String): String / Formatted \x3d\n    tryEmit(escape) ++ text ++ tryEmit(Escape::RESET)\n\n  def colored(text: String, color: Color): String / Formatted \x3d\n    tryEmit(color.applyForegroundColor) ++ text ++ tryEmit(Escape::RESET)\n}\n');
xA("common/regex.effekt",'module regex\n\nimport string\n\nextern include chez "text/pregexp.scm"\n\nextern type Regex\n\nrecord Match(matched: String, index: Int)\n\nextern def regex(str: String) at {}: Regex \x3d\n  js "new RegExp(${str})"\n  chez "(pregexp ${str})"\n  vm "regex::regex(String)"\n\ndef exec(reg: Regex, str: String): Option[Match] \x3d {\n  val v \x3d internal::exec(reg, str)\n  if (v.isUndefined)\n    None()\n  else\n    Some(Match(internal::matched(v), internal::index(v)))\n}\n\nnamespace internal {\n\n  /// The type RegexMatch is used internally to represent platform\n  /// dependent results of matching a regex.\n  extern type RegexMatch\n    // js: { matched: String, index: Int } | undefined\n    // vm: scala.util.matching.Regex.Match | null\n\n  extern def matched(r: RegexMatch) at {}: String \x3d\n    js "${r}.matched"\n    chez "(vector-ref ${r} 0)"\n    vm "regex::matched(RegexMatch)"\n\n  extern def index(r: RegexMatch) at {}: Int \x3d\n    js "${r}.index"\n    chez "(vector-ref ${r} 1)"\n    vm "regex::index(RegexMatch)"\n\n  extern js !!!MULTILINEMARKER!!!\n    function regex$exec(reg, str) {\n      var res \x3d reg.exec(str);\n      if (res \x3d\x3d\x3d null) { return undefined }\n      else { return { matched: res[0], index: res.index } }\n    }\n  !!!MULTILINEMARKER!!!\n\n  extern chez !!!MULTILINEMARKER!!!\n  (define regex-exec\n    (lambda (regex str)\n      (let* ([positions (pregexp-match-positions regex str)]\n        [match (pregexp-match regex str)])\n    (if (and positions match)\n        (vector (car match) (caar positions))\n        #f))))\n  !!!MULTILINEMARKER!!!\n\n  extern def exec(reg: Regex, str: String) at io: RegexMatch \x3d\n    js "regex$exec(${reg}, ${str})"\n    chez "(regex-exec ${reg} ${str})"\n    vm "regex::exec(Regex, String)"\n}');
xA("common/result.effekt",'module result\n\nimport effekt\nimport option\nimport exception\n\n/// Represents the result of a potentially failing computation.\n/// It is the "reification" of the Exception[E] effect.\ntype Result[A, E] {\n  Error(exception: E, msg: String);\n  Success(a: A)\n}\n\n/// Represent ("reify") the result of a potentially failing computation.\ndef result[A, E] { f: \x3d\x3e A / Exception[E] }: Result[A, E] \x3d try {\n  Success(f())\n} with Exception[E] {\n  def raise(exc, msg) \x3d Error(exc, msg)\n}\ndef result[A, E](proxy: on[E]) { f: \x3d\x3e A / Exception[E] }: Result[A, E] \x3d try {\n  Success(f())\n} with Exception[E] {\n  def raise(exc, msg) \x3d Error(exc, msg)\n}\n\n/// Extracts the value of a result, if available\n/// Monadic "reflection"\ndef value[A, E](r: Result[A, E]): A / Exception[E] \x3d r match {\n  case Success(a) \x3d\x3e a\n  case Error(exc, msg) \x3d\x3e do raise(exc, msg)\n}\n\n/// Converts a result to an option forgetting the error details\ndef toOption[A, E](r: Result[A, E]): Option[A] \x3d r match {\n  case Success(a) \x3d\x3e Some(a)\n  case Error(exc, msg) \x3d\x3e None()\n}\n\ndef isError[A, E](r: Result[A, E]): Bool \x3d\n  if (r is Error(_, _)) true else false\n\ndef isSuccess[A, E](r: Result[A, E]): Bool \x3d\n  if (r is Success(_)) true else false');
xA("common/string.effekt",'module string\n\nimport effekt\nimport option\nimport stream\nimport list\nimport exception\nimport result\nimport char\nimport bytearray\n\n// TODO\n// - [ ] handle unicode codepoints (that can span two indices) correctly\n// - [ ] use string buffers or other buffers to implement repeated concatenation more efficiently (and `join`)\n// - [ ] maybe use native implementations for toInt, repeat, split, indexOf, etc.\n\n/**\n * Strings\n * - JS: Strings are represented as UTF-16 code units where some characters take 2 slots (surrogate pairs)\n * - Chez: Strings are sequences of unicode characters (?)\n * - LLVM: UTF-8 (characters can take from 1-4 bytes).\n */\n\n\n// Operations\n// ----------\n\ndef substring(str: String, from: Int, to: Int): String \x3d {\n  def clamp(lower: Int, x: Int, upper: Int) \x3d max(lower, min(x, upper))\n  val lower \x3d clamp(0, from, to)\n  val upper \x3d clamp(0, to, str.length)\n  str.unsafeSubstring(lower, upper)\n}\n\ndef substring(str: String, from: Int): String \x3d\n  str.substring(from, str.length)\n\n\n/// Checks whether str starts with the given prefix at `from`\ndef isSubstringAt(str: String, prefix: String, from: Int): Bool \x3d {\n  with default[OutOfBounds, Bool] { false };\n\n  val stringLength \x3d str.length\n  val prefixLength \x3d prefix.length\n\n  def done?(index: Int): Bool \x3d index \x3e\x3d prefixLength\n  def matches?(index: Int): Bool \x3d prefix.charAt(index) \x3d\x3d str.charAt(index + from)\n\n  def go(index: Int): Bool \x3d\n    if (index.done?) true\n    else if (index.matches?) go(index + 1) else false\n\n  go(0)\n}\n\ndef startsWith(str: String, prefix: String): Bool \x3d\n  isSubstringAt(str, prefix, 0)\n\ndef endsWith(str: String, suffix: String): Bool \x3d\n  isSubstringAt(str, suffix, str.length - suffix.length)\n\n/// Repeats the given string n-times.\n///\n/// TODO use a more efficient way of appending strings like a buffer\ndef repeat(str: String, n: Int): String \x3d {\n  def go(n: Int, result: String): String \x3d {\n    if (n \x3c\x3d 0) result\n    else go(n - 1, result ++ str)\n  }\n  go(n, "")\n}\n\n/// Left-pad the given string with spaces\ndef padLeft(str: String, n: Int): String \x3d {\n  " ".repeat(n - str.length) ++ str\n}\n\n/// Right-pad the given string with spaces\ndef padRight(str: String, n: Int): String \x3d {\n  str ++ " ".repeat(n - str.length)\n}\n\n// TODO use .split() in JS\ndef split(str: String, sep: String): List[String] \x3d {\n  val strLength \x3d str.length\n  val sepLength \x3d sep.length\n\n  // special case: seperator is empty, just emit individual chars\n  def empty(index: Int, components: List[String]): List[String] \x3d\n    if (index \x3e\x3d strLength) components.reverse\n    else empty(index + 1, Cons(str.substring(index, index + 1), components))\n\n  def go(lastIndex: Int, components: List[String]): List[String] \x3d\n    indexOf(str, sep, lastIndex) match {\n      case None() \x3d\x3e\n        Cons(str.substring(lastIndex, strLength), components).reverse\n      case Some(index) \x3d\x3e\n        go(index + sepLength, Cons(str.substring(lastIndex, index), components))\n    }\n\n  if (sepLength \x3d\x3d 0) empty(0, Nil())\n  else go(0, Nil())\n}\n\ndef join(strings: List[String], sep: String): String \x3d {\n  def go(strings: List[String], result: String): String \x3d strings match {\n    case Nil() \x3d\x3e result\n    case Cons(s, rest) \x3d\x3e go(rest, result ++ sep ++ s)\n  }\n  strings match {\n    case Nil() \x3d\x3e ""\n    case Cons(first, rest) \x3d\x3e go(rest, first)\n  }\n}\n\nextern def trim(str: String) at {}: String \x3d\n  js "${str}.trim()"\n\n// Parsing\n// -------\ndef toBool(s: String): Bool / Exception[WrongFormat] \x3d s match {\n  case "true"  \x3d\x3e true\n  case "false" \x3d\x3e false\n  case _ \x3d\x3e wrongFormat("Not a boolean value: \'" ++ s ++ "\'")\n}\n\n// TODO optimize (right now this will be horribly slow (compared to the native JS version)\ndef toInt(str: String): Int / Exception[WrongFormat] \x3d {\n  def go(index: Int, acc: Int): Int \x3d {\n    // wrong index means we\'re done parsing\n    with on[OutOfBounds].default { () \x3d\x3e acc };\n\n    val c \x3d str.charAt(index)\n    val d \x3d char::digitValue(c)\n    go(index + 1, 10 * acc + d)\n  }\n\n  with on[OutOfBounds].default {\n    wrongFormat("Empty string is not a valid number")\n  }\n\n  str.charAt(0) match {\n    case \'-\' \x3d\x3e 0 - go(1, 0)\n    case _   \x3d\x3e go(0, 0)\n  }\n}\n\n// TODO optimize (right now this will be horribly slow (compared to the native JS version)\ndef toInt(str: String, base: Int): Int / Exception[WrongFormat] \x3d {\n  if (base \x3e 36 || base \x3c 1) {\n    wrongFormat("Invalid base: " ++ base.show)\n  }\n\n  def go(index: Int, acc: Int): Int \x3d {\n    // wrong index means we\'re done parsing\n    with on[OutOfBounds].default { () \x3d\x3e acc };\n\n    val c \x3d str.charAt(index)\n    val d \x3d char::digitValue(c, base)\n    go(index + 1, base * acc + d)\n  }\n\n  with on[OutOfBounds].default {\n    wrongFormat("Empty string is not a valid number")\n  }\n\n  str.charAt(0) match {\n    case \'-\' \x3d\x3e 0 - go(1, 0)\n    case _   \x3d\x3e go(0, 0)\n  }\n}\n\n/// Native versions of toInt (unused right now)\nextern def unsafeToInt(str: String) at {}: Int \x3d\n  js "(Number.isNaN(parseInt(${str})) ? undefined : parseInt(${str}))"\n  chez "(string-\x3enumber ${str})"\n\n\n/// Returns the index of the first occurrence of `sub` in `str`\ndef indexOf(str: String, sub: String): Option[Int] \x3d\n  indexOf(str, sub, 0)\n\ndef indexOf(str: String, sub: String, from: Int): Option[Int] \x3d {\n  val len \x3d str.length\n  def go(index: Int): Option[Int] \x3d\n    if (index \x3e\x3d len) None()\n    else if (str.isSubstringAt(sub, index)) Some(index)\n    else go(index + 1)\n\n  go(from)\n}\n\n/// Returns the index of the last occurence of `sub` in `str`\ndef lastIndexOf(str: String, sub: String): Option[Int] \x3d\n  lastIndexOf(str, sub, str.length)\n\ndef lastIndexOf(str: String, sub: String, from: Int): Option[Int] \x3d {\n  def go(index: Int): Option[Int] \x3d\n    if (index \x3c 0) None()\n    else if (str.isSubstringAt(sub, index)) Some(index)\n    else go(index - 1)\n\n  go(from)\n}\n\n// TODO more efficient (native) implementations could be integrated as follows\n\n// extern def indexOf(str: String, sub: String) at {}: Option[Int] \x3d\n//   //js { nativeIndexOf(str, sub) }\n//   default { indexOf(str, sub, 0) }\n\n// def nativeIndexOf(str: String, sub: String): Option[Int] \x3d {\n//   val index \x3d str.unsafeIndexOf(sub)\n//   if (index \x3c 0) { None() } else { Some(index) }\n// }\n\n// extern def unsafeIndexOf(str: String, sub: String) at {}: Int \x3d\n//   js "${str}.indexOf(${sub})"\n\ndef charAt(str: String, index: Int): Char / Exception[OutOfBounds] \x3d\n  if (index \x3c 0 || index \x3e\x3d length(str))\n    do raise(OutOfBounds(), "Index out of bounds: " ++ show(index) ++ " in string: \'" ++ str ++ "\'")\n  else\n    unsafeCharAt(str, index)\n\nextern def unsafeCharAt(str: String, n: Int) at {}: Char \x3d\n  js "${str}.codePointAt(${n})"\n  chez "(char-\x3einteger (string-ref ${str} ${n}))"\n  llvm !!!MULTILINEMARKER!!!\n    %x \x3d call %Int @c_bytearray_character_at(%Pos ${str}, %Int ${n})\n    ret %Int %x\n  !!!MULTILINEMARKER!!!\n  vm "string::unsafeCharAt(String, Int)"\n\n\n// Streaming\n// ---------\n\ndef feed[R](string: String) { reader: () \x3d\x3e R / read[Char] } \x3d\n  feed(string.fromString) {\n    decodeUTF8 {\n      reader()\n    }\n  }\n\ndef each(string: String): Unit / emit[Char] \x3d\n  feed(string) {\n    exhaustively {\n      do emit(do read())\n    }\n  }\n\ndef collect { stream: () \x3d\x3e Unit / emit[Char] }: String \x3d\n  returning::collect[Unit]{stream}.second\n\nnamespace returning {\n  def collect[R] { stream: () \x3d\x3e R / emit[Char] }: (R, String) \x3d {\n    val (result, bytes) \x3d bytearray::returning::collect[R] { encodeUTF8 { stream } }\n    (result, bytes.toString)\n  }\n}\n');
